import Main from './main'

function NameList() {
  const persons = [
    {
      id: 1,
      name: 'Adil',
      age: 17,
      skill: 'React'
    },
    {
      id: 2,
      name: 'Nurislam',
      age: 18,
      skill: 'Solidity'
    },
    {
      id: 3,
      name: 'Danil',
      age: 18,
      skill: 'React and Solidity'
    }
  ]

const namesList = persons.map(person => 
<h1>
  Hello, My name is {person.name}. I'm {person.age} years old. I'm learning {person.skill}
</h1>)


  return (
    <div>
      <Main list = {namesList}></Main>
    </div>
  )
}

export default NameList
